package id.co.aio.procure_to_pay.avm2;

/*This is a Studio Managed File. DO NOT EDIT THIS FILE. Your changes may be reverted by Studio.*/

import java.io.Serializable;
import java.util.Objects;

public class VBankId implements Serializable {

    private String countryKey;
    private String bankKey;

    public String getCountryKey() {
        return this.countryKey;
    }

    public void setCountryKey(String countryKey) {
        this.countryKey = countryKey;
    }

    public String getBankKey() {
        return this.bankKey;
    }

    public void setBankKey(String bankKey) {
        this.bankKey = bankKey;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof VBank)) return false;
        final VBank vbank = (VBank) o;
        return Objects.equals(getCountryKey(), vbank.getCountryKey()) &&
                Objects.equals(getBankKey(), vbank.getBankKey());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getCountryKey(),
                getBankKey());
    }
}